import react, { useState } from 'react';

const WordsList = ({ wordsList }) => {
    return (
        <div className="wordsList">
            <h2>영단어 목록</h2>
            {wordsList.map(item => {
                return (
                <div key={item.id}>
                    <b>영단어</b> 
                    <div>{item.english}</div>
                    <b>뜻</b>
                    <div>{item.korean}</div>
                </div>
                )
            })}
        </div>
    );
};

export default WordsList;
